import Link from 'next/link';

const linkStyle = {
  marginRight: 15
};

const PostLink = props => (
  <li>
    <Link href={`/p/[id]`} as={`/p/${props.id}`}>
      <a>{props.id}</a>
    </Link>
  </li>
);
const Header = () => (
  <div>
    <PostLink id="Hello Next.js" />
    <PostLink id="Learn Next.js" />
  </div>
);

export default Header;
